Look again at the view function get_num. It returns an i8. However, any call to a NEAR contract happens via Remote Procedure Calls , and this i8 needs to be serialized into something the consumer can read. By default, near_bindgen generates code to serialize it into a JSON number, since this is the most common case, e.g. a web app calling get_num. If you really need to, you can override this setting. For example, this would serialize it to Borsh instead: #[result_serializer(borsh)]
pub fn get_num(&self) -> i8 { self.val
} Serializing to Borsh can be useful in a couple cases: gas -intensive contract methods that need to optimize every detail methods only used in cross-contract call logic, where no external consumers are expected or allowed However, most of the time you will probably want to stick with the default JSON result serialization, to make it easier for apps to interact with your contract.

