Rust's type system gives us a way to tell NEAR's Runtime how our contract's state is shaped. If you're following along, look for the struct definition on line 10: pub struct Counter { val: i8,
} About this: Thing Explanation struct A data structure with fields, similar to a class, object, Hash, or Dictionary in other languages. This struct is named Counter; you could name it whatever you want. val This is a variable name; you could change it (using the F2 key in VS Code) to anything else you want, such as counter or number or num. i8 val is of type i8, a signed 8-bit integer. This means it can be between -128 and 127. For more on Rust's number types, check out The Rust Book's description . For more on why i8 goes from negative 128 but only to positive 127, search for primers about how numbers get stored as binary . pub Short for public, meaning that the item is visible outside of the file. You need this on the struct you intend to store in contract storage. Technically pub is a namespace , but that's not important right now. Ok, straightforward enough. But if you're actually looking at the code in your own editor, you're probably wondering about the stuff right above pub struct Counter: #[near_bindgen]
#[derive(Default, BorshDeserialize, BorshSerialize)]
pub struct Counter { val: i8,
} These are called macros . Macros are Rust's way of generating extra code. This kind of "hash bracket" macro (#[...]) will expand the definition of the thing that follows, adding extra logic to save you from needing to copy-paste boilerplate. (The other kind of Rust macro looks like a function, but has an exclamation mark, like log!(...). You'll see this soon.) Here's what these macros are doing: Thing Explanation near_bindgen Generates bindings for NEAR. This is how you tell the NEAR Runtime that this is the struct you want to put in contract storage. derive(...) The derive attribute . Takes a list of derive macros , and generates extra code for each one. Default Generates a default value for the struct. If you check the rest of the file, you'll see that we never initialize Counter or val. But when you deploy the contract, you'll see that val defaults to 0. BorshSerialize Generates boilerplate for taking your in-memory contract data and turning it into borsh-serialized bytes to store on-disk. BorshDeserialize Generates boilerplate for reading borsh-serialized, on-disk bytes and turning them into in-memory data structures. Expand this section to see the code the above derive macro will generate. impl ::core::default::Default for Counter { #[inline] fn default() -> Counter { Counter { val: ::core::default::Default::default(), } }
}
impl borsh::de::BorshDeserialize for Counter
where i8: borsh::BorshDeserialize,
{ fn deserialize(buf: &mut &[u8]) -> ::core::result::Result<Self, borsh::maybestd::io::Error> { Ok(Self { val: borsh::BorshDeserialize::deserialize(buf)?, }) }
}
impl borsh::ser::BorshSerialize for Counter
where i8: borsh::ser::BorshSerialize,
{ fn serialize<W: borsh::maybestd::io::Write>( &self, writer: &mut W, ) -> ::core::result::Result<(), borsh::maybestd::io::Error> { borsh::BorshSerialize::serialize(&self.val, writer)?; Ok(()) }
}
